import React from 'react';

class Footer extends React.Component {

    constructor(props) {

        super(props);

        this.state = {
            msg:'Criado por Donovan Sousa. @2019 - Todos os direitos reservados.'
        }
    }

    render() {
        
        const {state} = this;

        return (
            <div>
                <p>{state.msg}</p>
            </div>
        )
    }
}

export default Footer;
